import React from "react";
import { Carousel } from 'react-responsive-carousel';
import { Link } from "react-router-dom";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader

export default function SpringCarousel (props) {
    // const style = {
    //     display: 'block'
    // }
    // const pointerOn ={
    //     pointerEvents: 'auto'
    // }
    const [item, setItem] = useState(props.currentHotSpringSite);
    console.log(item);
    return(
        <div className="col-md-6 top10">
                <Carousel autoPlay={true} infiniteLoop={true} showArrows={true} swipeable={true} stopOnHover={true} emulateTouch={true}>
                    <div>
                            <Link to={`/sitedetail/${props.hotSpringDataObject[0].id}`}><img  src={props.hotSpringDataObject[0].image} /></Link>
                            <Link to={`/sitedetail/${props.hotSpringDataObject[0].id}`}><p classNameName="legend">{props.hotSpringDataObject[0].name}</p></Link>
                    </div>
                    <div>
                                <Link to={`/sitedetail/${props.hotSpringDataObject[1].id}`}><img  src={props.hotSpringDataObject[1].image} /></Link>
                                <Link to={`/sitedetail/${props.hotSpringDataObject[1].id}`}><p classNameName="legend">{props.hotSpringDataObject[1].name}</p></Link>
                    </div>
                </Carousel>
            <div className="clearfix">
            </div>			
        </div>
		
    )}
